import "./App.css";
import ExpenseItem from "./Components/ExpenseItem.js";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "car",
      amount: 782,
      date: "22 march 2021",
    },
    {
      id: "e2",
      title: "tv",
      amount: 222,
      date: "22 march 2021",
    },    
    {
      id: "e3",
      title: "book",
      amount: 21,
      date: "22 march 2021",
    },
  ];

  return (
    <div className="App">
      {
      expenses.map(
        (expense)=>
        { <ExpenseItem 
          title={expense[0].title} 
          amount={expense[0].amount} 
          date={expenses[0].date}
          />
        }
      )
      }


    </div>
  );
}

export default App;
